import data from "./aaaaaa.json";
let newData = [];

export function ido() {
  newData = data.map((e) => {
    let demo = [];
    for (let index = 0; index < e.changes.length; index++) {
      demo.push(e.changes[index].changeName);
      console.log(demo);
    }
    e.changes = demo;
    demo = [];
  });

  console.log(newData);
}
